import tw from 'tailwind.macro';

const StyledApp = styled.main.attrs({
    className: ""
})`
    & {
        form {
            ${tw``}
        }
        input {
            ${tw``}
        }
        button {
            ${tw``}
        }
    }
`

export default StyledApp;
